Albatrellus = '{"image":"data:image/jpeg;base64,", "text":"Альбатреллус овечий є їстівним грибом, який вживають свіжим, сушеним, маринованим, вареним, смаженим, тушкованим. Це смачний гриб, проте його жорстка мякоть погано перетравлюється і може спричинити розлад шлунково-кишкового тракту. У їжу вживають капелюшки молодих грибів, які перед вживанням відварюють. При відварюванні мякоть гриба стає жовтувато-зеленою. Ще один спосіб приготування полягає в обсмажуванні сирого альбатреллуса без відварювання. Також гриб маринують із спеціями, що дозволяє його довго зберігати."}';
Auriculyaria = '{"image":"data:image/jpeg;base64,", "text":"Аурикулярія вухоподібна є їстівним грибом середньої якості. Мякуш - щільна, хрящувата, хрумка."}';
Beliigrib = '{"image":"data:image/jpeg;base64,", "text":"Використовувати білий гриб рекомендують у свіжому, вареному, смаженому, сушеному або маринованому вигляді. Під час сушіння ці гриби набувають приємного запаху і не темніють. Сушеним меленим порошком із білого гриба заправляють різні страви. Також їдять білий гриб сирим, у салатах з олією, спеціями, соком лимона та сиром. Соус із білого гриба подають до страв із рису та мяса."}';
Beliistepnoigrib = '{"image":"data:image/jpeg;base64,", "text":"Вид є їстівним грибом, приємним на смак, його сушать та маринують. За харчовою цінністю білий степовий гриб прирівнюється до мяса та птиці, оскільки у ньому високий вміст амінокислот, білків, вітамінів та ферментів. У складі гриба було також знайдено речовину ловастанин, яка запускає процес руйнування холестерину у печінці."}';
Borovik = '{"image":"data:image/jpeg;base64,", "text":"Боровики належать до категорії їстівних грибів, мають безліч корисних властивостей та гарні смакові якості. Проте існує понад 300 видів боровиків, серед яких є як їстівні, так і неїстівні та токсичні гриби. Тому будьте обережні."}';
Veshenka = '{"image":"data:image/jpeg;base64,", "text":"Гливи – їстівні гриби. У їжу використовують молоді гриби (7-10 см) без твердої ніжки. Зрілі гриби для споживання надто жорсткі."}';
Volnuhka = '{"image":"data:image/jpeg;base64,", "text":"Хвилина є умовно-їстівним грибом гарної якості. Хвиля – непростий у приготуванні в гриб через вміст гіркого соку. Тому хвиляшку добре вимочують у підсоленій воді. У їжу вживають хвиляшку в солоному та маринованому вигляді, у других стравах також і у свіжому вигляді. Ці гриби відмінно підходять для смаження та приготування соусів для мяса та овочів. Хороші хвилі і як гарнір: просте обсмажування з цибулею і сметаною дає смачну страву. У засоле цінуються молоді гриби (діаметр капелюшка до 3-4 см), їх називають "завитки". Перед приготуванням хвилі ретельно вимочують і бланшують. Недостатньо проварена перед приготуванням хвилішка викликає подразнення слизових оболонок і може спричинити кишковий розлад. Солоні хвилі використовують через 45-50 днів після засолу."}';
Gigrofor = '{"image":"data:image/jpeg;base64,", "text":"Гігрофори є їстівними грибами із широким рядом корисних властивостей. Так, цей вид грибів містить вітаміни (В, А, С, D, РР), амінокислоти та різноманітні макро- та мікроелементи (фосфор, кальцій, калій, сірку, натрій, марганець, цинк, йод). За рівнем вмісту білка гігрофор наближається до мяса. Також гігрофори – це низькокалорійний продукт, який допомагає схуднути і виводить з організму токсини. Гігрофор має приємний, ніжний смак, його мякоть щільна і мясиста, гриб не сильно уварюється. Найчастіше гігрофори застосовують для засолів та маринадів, обсмажують зі сметаною та цибулею, або додають у жульєн, супи та соуси. При приготуванні гігрофора обовязково очищають його слизову оболонку, так вона має неприємний смак і може зіпсувати страву."}';
Golovach = '{"image":"data:image/jpeg;base64,", "text":"Головач є їстівним грибом. З кулінарною метою використовують виключно молоді гриби з чистою білою мякоттю. За поживними властивостями мякуш молодого головача прирівнюється до білого гриба, і навіть перевершує його за вмістом білка. Також до складу гриба входять вітаміни, вуглеводи, мікро- та макроелементи. Головач цінується серед гурманів завдяки незвичайному вишуканому смаку. А після термічної обробки гриб схожий на плавлений сир чи тофу. Мякуш гриба містить багато вологи, тому його можна не відварювати перед приготуванням, або ж варити в невеликій кількості води. Головачі подають смаженими, готують із них бульйони та грибний порошок. Старі гриби не рекомендується вживати через високої кількості токсинів у них. Тому також заборонено довго зберігати молодих головачів, оскільки вони при цьому набувають отруйних властивостей."}';
Gruzd = '{"image":"data:image/jpeg;base64,", "text":"Грузді є умовно-їстівними грибами із специфічним запахом. У сухих груздях міститься близько 32% білка, вітаміни D та B12. Гриби вважаються дієтичним продуктом, а заміна мясних страв грибними є профілактикою розвитку атеросклерозу та інших серцево-судинних захворювань. Свіжі грузді важливо правильно обробляти і готувати, щоб уникнути зараження таким небезпечним захворюванням, як ботулізм. Збирати гриби необхідно в екологічно чистих місцевостях далеко від доріг. А в їжу вживати в помірній кількості, особливо при захворюваннях шлунково-кишкового тракту. Не рекомендується їсти грузді вагітним і жінкам, що годують, а також дітям."}';
Dubovik = '{"image":"data:image/jpeg;base64,", "text":"Дубовик - їстівний, смачний, затребуваний у кулінарії гриб. У нього мясиста мякоть та ніжний запах, гриб добре підходить для засолів та маринадів. Гурмани вважають за краще обсмажувати дубовики, і заправляти таку страву вершковими соусами. Дубовик використовується як основна страва, гарнір, а також для приготування супів і бульйонів. Після термічної обробки гриб зберігає всі свої корисні якості, уварюється мало, а всім стравам надає особливого благородного смаку. Також дубовики сушать та заморожують, попередньо відваривши у підсоленій воді."}';
Zimniigrib = '{"image":"data:image/jpeg;base64,", "text":"Зимовий гриб відноситься до їстівних видів, особливо популярний він на кухні азіатських країн. Оскільки гриб добре переносить морози, його збирають і замороженим, і розмерзлим. Застосовується зимовий гриб у кулінарії свіжим, після відварювання протягом 20 хвилин, також його маринують і солять, консервують, сушать, готують із нього екстракти та грибний порошок. У молодого гриба обрізають темну частину ніжки, а у зрілих грибів збирають виключно капелюшки. Варений зимовий гриб стає слизьким."}';
Zontik = '{"image":"data:image/jpeg;base64,", "text":"Після очищення від лусочок капелюшки грибів-парасольок використовують у кулінарії у будь-якому вигляді, навіть у сирому. Ніжки у них жорсткі, волокнисті, тому їх не вживають. За смаком парасольки схожі на печериці. Особливо ці гриби цінують французькі гурмани, які обсмажують їх у олії із зеленню, як млинці. Попередньо капелюшки можна обваляти в панірувальних сухарях, муці або збитому яйці. Також парасольки запікають у духовці або роблять барбекю із зеленню, перцем та часником. Єдиний недолік грибів-парасольок при такому приготуванні полягає в тому, що вони сильно всмажуються. У свіжому та сухому вигляді гриби-парасольки застосовують для приготування супів. Молоді гриби також солять і маринують, використовують у салатах, їдять сирими і роблять з ними бутерброди."}';
Calozibe = '{"image":"data:image/jpeg;base64,", "text":"Калоцибе травневий є їстівним грибом, єдиним недоліком якого є характерний борошнистий запах. Зібраний травневий гриб перебирають, промивають і відварюють (це допомагає зменшити інтенсивність запаху борошна), потім додають у перші та другі страви, супи та рагу, роблять на його основі соління та маринади."}';                                             
Liofillum = '{"image":"data:image/jpeg;base64,", "text":"Ліофілум ільмовий є їстівним грибом середніх смакових якостей. У їжу його вживають свіжим після відварювання у підсоленій воді протягом 15-20 хвилин, а також гриб сушать, солять і маринують. Ліофіллум ільмовий не рекомендується включати до раціону дітей, людей похилого віку та людей із захворюваннями шлунка або печінки. Не слід вживати цей гриб разом із спиртними напоями."}';
Lisichka = '{"image":"data:image/jpeg;base64,", "text":"Існують як їстівні, так і неїстівні види лисичок. Лисичка звичайна має приємний запах і ніжний відтінок, а хибний гриб пахне рибою чи оцтом. Якщо гриби справжні, їх можна смажити, варити чи запікати. З лисичок виходять гарні запіканки, пироги, зрази та супи. На всі ці страви не піде більше години приготування. Також лисички можна посолити, замаринувати чи засушити, але для цього знадобиться більше часу."}';
Maslenok = '{"image":"data:image/jpeg;base64,", "text":"Маслюк - їстівний гриб, але існують такі види маслюків, які вживати категорично заборонено. Для того, щоб відрізнити справжнє масляно від неїстівного, варто звернути увагу на його запах. Слиз не повинен мати неприємного запаху. Якщо вона віддає запахом риби чи оцту, то такі гриби вживати не варто. За кольором несправжні маслята мають коричневий капелюшок із темною ніжкою. Мякуш мякий, його легко зігнути. На дотик гриби більш водянисті, а слиз тягучий і має коричневий відтінок. Найкращий спосіб приготувати маслюки - обсмажити, згасити або зварити. Ці процеси не займуть понад 30 хвилин. Також маслюки можна посолити або висушити, але для цього знадобиться кілька тижнів."}';
Mokrucha = '{"image":"data:image/jpeg;base64,", "text":"Мокруха - це маловідомий їстівний гриб, який підходить для всіх видів кулінарної обробки. За смаковими якостями цей гриб стоїть в одному ряду з маслюками. При термічній обробці мокрухи набувають пурпурового кольору. Перед приготуванням гриба його обовязково очищають від слизової шкіри."}';
Mohovik = '{"image":"data:image/jpeg;base64,", "text":"Серед моховиків є як їстівні, так і неїстівні. Їстівні види використовують у їжу без попереднього відварювання для перших страв, засолювання, маринування та сушіння. У кулінарії застосовується весь гриб: і капелюшок, і ніжка. Шкірку з капелюшка видаляють, а ніжку зачищають. Для покращення засвоєння грибів їх ретельно подрібнюють. Висушені моховики набувають красивого золотистого відтінку і приємного запаху. Моховики багаті на легкозасвоювані білки, цукри, ферменти та ефірні масла, вони містять також вітаміни А, В, В2, С, D і PP. Крім того, моховики містять специфічні речовини, які на повітрі швидко темніють, і псують зовнішній вигляд гриба. Тому перед приготуванням обробляти гриби потрібно швидко, щоб вони в очищеному вигляді довго не знаходилися на повітрі, відразу поміщають їх у воду. При відварюванні на літр води додають чайну ложку солі та половину чайної ложки лимонної кислоти."}';
Podberozovik = '{"image":"data:image/jpeg;base64,", "text":"Всі підберезники є їстівними грибами, окремі види відрізняються харчовими якостями незначно. Ці гриби містять вітаміни, наприклад, вітамін В1, В2, РР і вітамін С. У кулінарії підберезники використовують у смаженому, вареному та маринованому вигляді, також їх заготовляють про запас шляхом висушування. При сушінні гриб чорніє. Підберезники застосовуються як начинка для піци, пирога, рулету, як основа для соусів і у вигляді порошку. Ці гриби добре поєднуються з картоплею, гречкою, сочевицею, морквою, капустою, перцем. Підберезники заборонено вживати в їжу людям, з виразками шлунково-кишкового тракту, при індивідуальній непереносимості та дітям."}';
Podosinovik = '{"image":"data:image/jpeg;base64,", "text":"Всі подосиновики їстівні та практично однакові за харчовими якостями. Подосиновики гасять і відварюють, маринують і смажать, заморожують і сушать – у будь-якому вигляді ці дари лісу гарні та смачні. Щоб подосиновики не темніли (не чорніли), перед приготуванням їх вимочують у 0,5% розчині лимонної кислоти. "}';
Rizik = '{"image":"data:image/jpeg;base64,", "text":"Рижики є їстівними, делікатесними грибами і відрізняються багатьма корисними властивостями. Їх маринують, засолюють, сушать, відварюють та смажать. Перед приготуванням рижики не потрібно спеціально вимочувати, достатньо витерти вологою ганчіркою та обдати окропом. Смак рудиків збагачує перші та другі страви, а поживна цінність цих грибів корисна для здоровя. Амінокислоти, що входять до складу рудиків, добре засвоюються організмом. Як джерело білка цей вид грибів дорівнює мясу. Солоні та мариновані рижики є також досить калорійним продуктом, що за енергетичною цінністю перевершує яловичину, куряче мясо, яйця, оселедець."}';
Sparasis = '{"image":"data:image/jpeg;base64,", "text":"Спарасис кучерявий – це їстівний гриб, який використовується для приготування супів, смаження та сушіння. Їстівні тільки молоді гриби, так як плодові тіла в зрілому віці стають дуже жорсткими, набувають бурого забарвлення і вираженого гіркого смаку. А ось молодий спарасіс кучерявий – дуже смачний гриб, який за текстурою нагадує зморшки. Запах цього гриба специфічний, смак нагадує горіх. У кулінарії спарасіс кучерявий застосовується у сирому вигляді, для приготування салатів, супів, запікання з сиром, горіхами та морепродуктами., маринування. З цього гриба виходить хороша начинка для пирогів і пельменів, сушені гриби розтирають в порошок і додають соуси, підливи і тонізуючі напої."}';